import React from 'react';
import PetNamesComponent from './PetNamesComponent';

class PetNamesForm extends React.Component{
    constructor(props){
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.state = {
            petSpecie: '',
        };
    }

    handleSubmit(){
        this.setState({petSpecie: this.state.petSpecie});
    }

    render(){
        const petSpecie = 'dog';
        return (
            <><div className="pet-container-form">
                <form name="pet_name_form" id="pet_name_form">
                    <label>
                        Specie of your pet:
                    </label>
                    <select name="pet_specie" id="pet_specie" required>
                        <option value="dog">Dog</option>
                        <option value="cat">Cat</option>
                        <option value="bird">Bird</option>
                        <option value="fish">Fish</option>
                        <option value="snake">Snake</option>
                    </select>
                    <label className='submit-buttom'>
                        <input type="submit" value="Submit" 
                        onSubmit={(e) => this.props.getPetNames(e, petSpecie)} />
                    </label>
                </form>
            </div>
            </>
        )
    }

    getPetNames(petSpecie){
        console.log(petSpecie);
        return <PetNamesComponent specie={petSpecie} />
    }

}

export default PetNamesForm;
